import { Link } from 'react-router-dom';


const Navbar = ({ isLoggedIn, onLogout }) => {
  
    // Conditionally render the button only if not on the CustomerLogin page
    
    return (
      <div className='Navbar'>
       

        <div>
          <Link to="/FlightSearch"> SEARCH FLIGHTS</Link>
        </div>

        <div>
          <Link to="/StatusSearch"> SEARCH FLIGHT STATUS</Link>
        </div>

        <div><p>pasd</p>></div>

      <ul>
        {isLoggedIn ? (
          <>
            <li>User is logged in</li>
            <li onClick={onLogout}>Logout</li>
          </>
        ) : (
          <div>
          <Link to="/Login">LOGIN HERE</Link>
        </div>
        )}
    </ul>
      </div>
    );
    
  
    // If on the CustomerLogin page, don't render the button
    // return null;
  };

export default Navbar
